// Settings.js

import React from 'react';

function Settings(){
  return (
    <div style={{ padding: '1em', height: '85%', overflowY: 'scroll', width: '168vh' }}>
      <h1 style={{ color: 'white', width: '100%' }}>Settings</h1>
      <div className="w-100"></div>
    </div>
  );
};

export default Settings;
